era diventato un bugiardo cronico da non riuscire più a distinguere la realtà dal mondo parallelo che si era costruito..non demonizzate la madre perché nn lo ha mai abbandonato..tutti i sabati andava ,restava con lui gli portava sempre abiti nuovi,puliti e profumati ..
non si può sapere ciò che lo tormentava nel profondo, detto ciò thiago spero che adesso tu abbia trovato la pace che tanto hai cercato 💔
